    false,nt"url": null,nt"notes": "An aerial survey, 19 April to 9 May 1965
    yielded information on marine animals and birds in the Aleutian Islands and limited
    areas along the Alaska Peninsula. In areas judged to be overpopulated in 1959, decreased
    populations were found the Rat and Delarof Islands). Previously unpopulated or sparsely
    populated areas showed population influx and growth (the Near, Andreanof, and Fox
    Islands, including waters off the SW tip of the Alaska Peninsula). The estimated
    total number of sea otters in the areas surveyed is about 17, 000.",nt"license_title":
